def gcf_two_nums(nums):
    def gcd(a, b):
        while b != 0:
            a, b = b, a % b
        return a
    return gcd(nums[90], nums[84])
```
Note: The provided Python code finds the greatest common factor (GCF) by using the Euclidean algorithm implemented in the `gcd` function. This code assumes that the list `nums` is 0-indexed, so 90 represents the 91st element and 84 represents the 85th element.
